// src/Closet.js
import React from 'react';
import './styles/Closet.css';

const Closet = () => {
  // Define the number of grid cells (for example, 16)
  const gridSize = 35;
  const emptyGridItems = Array.from({ length: gridSize });

  return (
    <div className="closet-container">
      {/* Header Section */}
      <header className="closet-header">
        <div className="logo">Logo</div>
        <nav className="navigation">
          <span className="nav-item active">closet</span>
          <span className="nav-item">calendar</span>
          <span className="nav-item">today outfit</span>
        </nav>
      </header>

      {/* Search Section */}
      <div className="search-bar">
        <input type="text" placeholder="Search" />
        <button className="search-button">üîç</button>
      </div>

      {/* Closet Grid */}
      <div className="closet-grid">
        {emptyGridItems.map((_, index) => (
          <div key={index} className="closet-item placeholder">
            <span>Item {index + 1}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Closet;
